const ConvertDataForLineChart = (eventDurations) => {
    const lineChartData = [];

    // Iterar sobre os dados de duração do evento
    for (const eventType in eventDurations) {
      // Obter as durações para o tipo de evento atual
      const durations = eventDurations[eventType];

      // Formatar os dados para o gráfico de linhas
      const formattedData = durations.map((duration, index) => ({
        x: index, // ou qualquer outro valor x que você queira atribuir (por exemplo, tempo)
        y: duration,
      }));

      // Adicionar a série de dados ao conjunto de dados para o gráfico de linhas
      lineChartData.push({
        name: eventType,
        data: formattedData,
      });
    }

    return lineChartData;
};
